	[h: foundIt = json.contains(jsonSkills, skill)]
	[h, if( foundIt ), code: {
		[h: cat = json.get(json.get(jsonSkills, skill), "category")]
		[h: rat = json.get(json.get(jsonSkills, skill), "rating")]
