		[h: cat = ""]
		[h: rat = 0]
	}]
	[h, if( setting.isInvestigative(cat)):
		investigative = investigative + rat; 
		general = general + rat
	]
	<!-- find highest -->
	[h, if( rat  >= highest ), code: {
		[h: skill1 = skill]
		[h: highest = rat]
	}; {}]
	[h, if( rat < highest && rat >= second ),code: {
		[h: skill2 = skill]
		[h: second = rat]
	}; {}]
}]
