[H, if(menu == "Macro Select"), code: {
   [H: macroGroups = am.test.getGroups(id)]
   [H: am.test.local.loadGroupsMenu()]
   [H: counter = 0]
   [H: groupIndexes = ""]
   [H, foreach(groupName,macroGroups), code: {
      [H: counter = counter + 1]
      [H: nameValue = eval("group_"+counter)]
      [H: indexes = json.get(macroGroups,groupName)]
      [H, if(nameValue): groupIndexes = listAppend(groupIndexes,indexes)]
   }]
   [H, if(json.isEmpty(groupIndexes)): groupIndexes = "[]"; groupIndexes = json.fromList(groupIndexes)]
};{
   [H: groupIndexes = "[]"]
}]
[H, if(menu == "Macro Select"), code: {
   [H: macroIndexes = ""]
   [H, foreach(index,allIndexes), code: {
      [H: nameValue = eval("index."+index)]
      [H, if(nameValue): macroIndexes = listAppend(macroIndexes,index)]
   }]
   [H, if(json.isEmpty(macroIndexes)): macroIndexes = "[]"; macroIndexes = json.fromList(macroIndexes)]
};{
   [H: macroIndexes = "[]"]
}]
[H, switch(menu), code: 
   case "All Macros":   {  [H: selectedIndexes = allIndexes]};
   case "Macro Select": {  [H: selectedIndexes = json.union(groupIndexes,macroIndexes)]};
   default:             {  [H: selectedIndexes = ""]}
]
[H: return = json.set("{}","selectedIndexes",selectedIndexes,"options",json.set("","taAction",taAction))]
[H: macro.return = return]

